import React, { Component } from "react";
import axios from "axios";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Register from "./components/Register";
class App extends Component {
  render() {
    return (
      <Router>
        <Route
          path="/"
          render={() => {
            return Register;
          }}
        />
      </Router>
    );
  }
}

export default App;
